import React  from "react";
import AmazonLogo from "../images/amazon_logo.png";

function LoginComponent() {
    return (
        <div>
            <img src={AmazonLogo} alt="Amazon Logo" />
            <div style={{ border: '2px solid black', padding: '10px', margin: '5px' }}>                
                <h2>Sign in or Create an Account</h2>
                <p>Enter mobile number or email</p>
                <textarea placeholder="Mobile number or email" rows="1" cols="30"></textarea>
                <br></br>
                <p>Password</p>
                <textarea placeholder="Password" rows="1" cols="30"></textarea>
                <br></br>
                <button style={{ backgroundColor: 'blue', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '5px' }}>Sign In</button>
                <br></br>


            </div>
        </div>
    );
}

export { LoginComponent };
